                    <br/>
                    <h3 ><b>THE TEAM</b></h3>
                    <div className="row">
                        <div className="col-lg-6 col-md-6 col-sm-6">
                            <img style={style} src="/static/images/theteam/logo-aowsay2.png" className="img-fluid" />
                        </div>
                    </div>
                </div>
            </div>                
        </Layout>        
    )
}

